import { Link } from 'react-router-dom';
import './Main.css';
import ImageCard from './components/ImageCard';
import collage from './images/collage.jpeg';
import './Main.css';
function Main(){
    return (
        <div className='main'>
           <div className='items'>
                <Link to='./Collage' > <ImageCard title='' image={collage} /> <h2>Collage</h2></Link>
                <Link to='./Carousel' > <ImageCard title='' image={collage} /> Carousel</Link>
                <Link to='./Scrolling' > <ImageCard title='' image={collage} /> Scrolling</Link>
           </div>
        </div>
    );
}
export default Main;
